import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

import logo from './logo.svg';
import './App.css';
import NavigationBar from './components/NavigationBar';
import Hero from './components/Hero';

function App() {
  return (
    <Router>
      <NavigationBar/>
      <Routes>
        <Route path="/profile">
          <h1>Welcome</h1>
        </Route>
        <Route path="/">
          <div className="App">
            {/* <img src={logo} className="App-logo" alt="logo" /> */}
            <Hero />
          </div>
        </Route>
      </Routes>
    </Router>

  );
}

export default App;
